import React from "react";
import "./Style.css";
import constant from "./constants";

let colors = constant.colors;
const Number = props => (
  <button
    className="Number"
    style={({ width: "100px" }, { backgroundColor: colors[props.index] })}
  >
    {props.value}
  </button>
);

export default Number;
